import React, { Component } from "react";
import { Layout, Navigation, Header, Drawer, Content, Footer } from "react-mdl";
import "./App.css";
import AboutMeComponent from "../src/component/AboutMeComponent";
import AboutUnsplashComponent from "../src/component/AboutUnsplashComponent";
import ContactComponent from "../src/component/ContactComponent";
import MainComponent from "../src/component/MainComponent";
import HistoryComponent from "../component/HistoryComponent"
import { Route, Switch } from "react-router-dom";
import NotFound from "./component/NotFound";
import {Link} from 'react-router-dom'


class App extends Component {
  render() {
    return (
      <div className="appJs">
        {/* Uses a header that scrolls with the text, rather than staying locked at the top */}
        <div className="demo-big-content" id="navBar">
          <Layout>
            <Header title="Capture the Image" scroll>
              <Navigation>
                <Link to="/">What We Do</Link>
                <Link to="/">History of Photograpy</Link>

              </Navigation>
            </Header>
            <Drawer title="Capture the Image">
              <Navigation>
              <Link to="/AboutUnsplashComponent">What We Do</Link>
                <Link to="/HistoryComponent">History of Photograpy</Link>
                <Link to="/AboutMeComponent">Developer</Link>
                <Link to="/">Contact</Link>
              </Navigation>
            </Drawer>
            <Content>
              <div className="page-content" />
            </Content>
          </Layout>
        </div>

        <div className="displayMain">
          <div className="innerDisplayMainLeft"></div>
          <div className="innerDisplayMainRight">
            <Switch>
              <Route exact path='/' render={ props=>(
                  <MainComponent/>
              )

              }/>
              <Route exact path='/AboutMeComponent' component={AboutMeComponent}/>
              <Route exact path='/AboutUnsplashComponent' component={AboutUnsplashComponent}/>
              <Route exact path='/ContactComponent' component={ContactComponent}/>     
              <Route exact path='/HistoryComponent' component={HistoryComponent}/>             
              <Route component={NotFound}></Route>
            </Switch>
          </div>
        </div>

        <div className="footer">
          <Footer />
        </div>
      </div>
    );
  }
}

export default App;
